import Header from './components/Header';
import ChatScreen from './pages/ChatScreen';
import Home from './pages/Home';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Header />
      <Routes>
        <Route path="/" />
        <Route />
      </Routes>
      <Home />
      <ChatScreen />
      {/* <Footer /> */}
    </>
  );
}

export default App;
